#!/usr/bin/env python3

seq = ''


dna = 'GAATTC'


rev_seq = seq[::-1]

rev_seq = rev_seq.replace('G','c')
rev_seq = rev_seq.replace('C','g')
rev_seq = rev_seq.replace('A','t')
rev_seq = rev_seq.replace('T','a')
com_rev_seq = rev_seq.upper()


indice = seq.find(dna)
print(indice)

indice3 = seq.find(com_rev_seq)
print(indice3)








